  false,\n\t\"url\": null,\n\t\"notes\": \"This is a brief overview of the water management
  program at Presquile National Wildlife Refuge in 1960. The refuge maintains wintering
  flocks of ducks and geese annually and serves as a valuable link in the chain of
  Atlantic Flyway refuges. Tidal flooding of the swamp and marsh areas promote feeding
  and resting use by waterfowl and the removal of unusable plant material.\",\n\t\"owner_org\":
